import { Component, h } from '@stencil/core';
import '@stencil/router';
import { routes } from './routes';
export class IotTestRoutes {
  render() {
    return (h("stencil-router", null,
      h("stencil-route-switch", { scrollTopOffset: 0 }, routes.map((r) => (h("stencil-route", { key: r.url, url: r.url, component: r.component, exact: true }))))));
  }
  static get is() { return "iot-test-routes"; }
}
